```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Define the data pin connected to the 1-Wire bus
#define ONE_WIRE_BUS 2

// Initialize the OneWire library
OneWire oneWire(ONE_WIRE_BUS);

// Initialize the DallasTemperature library
DallasTemperature sensors(&oneWire);

void setup() {
  Serial.begin(9600);
  sensors.begin();
}

void loop() {
  // Request temperatures from all sensors
  sensors.requestTemperatures();

  // Get the number of connected sensors
  int numSensors = sensors.getDeviceCount();

  // Loop through each sensor
  for (int i = 0; i < numSensors; i++) {
    // Get the sensor address
    String address = sensors.getAddress(i);

    // Get the temperature in Celsius
    float temperatureC = sensors.getTempCByIndex(i);

    // Print the sensor address and temperature
    Serial.print("Sensor ");
    Serial.print(address);
    Serial.print(": ");
    Serial.print(temperatureC);
    Serial.println("°C");
  }

  delay(2000); // Wait 2 seconds before reading again
}
```

**Explanation:**

1. **Include Libraries:** The code includes the `OneWire` and `DallasTemperature` libraries, which are necessary for communicating with Dallas 18B20 sensors.
2. **Define Pin:** The `ONE_WIRE_BUS` constant defines the GPIO pin connected to the 1-Wire bus.
3. **Initialize Objects:** The `OneWire` and `DallasTemperature` objects are initialized with the specified pin.
4. **Setup Function:** The `setup()` function initializes the serial communication and starts the DallasTemperature library.
5. **Loop Function:** The `loop()` function repeatedly:
   - Requests temperature readings from all connected sensors.
   - Gets the number of connected sensors.
   - Iterates through each sensor, retrieving its address and temperature in Celsius.
   - Prints the sensor address and temperature to the serial monitor.
   - Waits for 2 seconds before reading again.

**Remember:**

* Replace `2` with the actual GPIO pin connected to your 1-Wire bus.
* Connect your Dallas 18B20 sensors to the 1-Wire bus according to the wiring diagram.
* Upload the code to your ESP32 board.
* Open the serial monitor to view the sensor addresses and temperatures.

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
  int i, j, temp;
  for (i = 0; i < n - 1; i++) {
    for (j = 0; j < n - i - 1; j++) {
      if (arr[j] > arr[j + 1]) {
        // Swap arr[j] and arr[j+1]
        temp = arr[j];
        arr[j] = arr[j + 1];
        arr[j + 1] = temp;
      }
    }
  }
}

int main() {
  int arr[] = {64, 34, 25, 12, 22, 11, 90};
  int n = sizeof(arr) / sizeof(arr[0]);

  bubbleSort(arr, n);

  printf("Sorted array: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }
  printf("\n");

  return 0;
}
```

**Explanation:**

1. **`bubbleSort` function:**
   - Takes an integer array `arr` and its size `n` as input.
   - Uses two nested loops to iterate through the array.
   - The outer loop runs `n-1` times, as the last element will be in its correct position after `n-1` passes.
   - The inner loop compares adjacent elements and swaps them if they are in the wrong order.
   - This process "bubbles" the largest element to the end of the array in each pass.

2. **`main` function:**
   - Defines an example array `arr`.
   - Calculates the size of the array `n`.
   - Calls the `bubbleSort` function to sort the array.
   - Prints the sorted array.



