  if (!interaction.isCommand()) return;

  if (interaction.commandName === 'ban') {
    const member = interaction.options.getMember('member');
    const reason = interaction.options.getString('reason');

    if (!member) {
      await interaction.reply({ content: 'Please provide a valid member to ban.', ephemeral: true });
      return;
    }

    if (!interaction.guild.members.me.permissions.has('BAN_MEMBERS')) {
      await interaction.reply({ content: 'I need the `BAN_MEMBERS` permission to ban users.', ephemeral: true });
      return;
    }

    await member.ban({ reason });
    await interaction.reply({ content: `Successfully banned ${member.user.tag} for ${reason}`, ephemeral: true });
  }
});

client.login('YOUR_BOT_TOKEN');
